import logo from "./logo.svg";
import "./App.css";

function App() {
  return (
      <div className="container">
      <div className = "navbar">
        <div className = "searchbar">
      <i className="fa-solid fa-magnifying-glass"></i></div>
      </div>
      <div className = "main">
        <div className = "mainLeft"></div>
        <div className = "mainRight"></div>
      </div>
    </div>
  );
}

export default App;
